import React from "react";
import "../styles/Time.css";

const secoes = [
  {
    titulo: "Diretoria",
    descricao: "",
    membros: [
      { id: 1, nome: "Rodrigo Machado", cargo: "Co-Diretor Executivo" },
      { id: 2, nome: "Luis Otavio Ribeiro", cargo: "Co-Diretor Executivo" },
    ],
  },
  {
    titulo: "Operações",
    descricao: "Garantimos que nossa operação esteja sempre rodando com tranquilidade",
    membros: [
      { id: 3, nome: "Renata Cybelle", cargo: "Analista de Suporte" },
      { id: 4, nome: "Josiane Sá", cargo: "Analista de Administração" },
      { id: 5, nome: "Taynara Ferreira", cargo: "Analista de Finanças" },
      { id: 6, nome: "Fernanda Bandeira", cargo: "Gerente de Operações" },
      { id: 7, nome: "Anna Rosa", cargo: "Estagiária de Segurança & Confiança" },
      { id: 8, nome: "Rafael Cruz", cargo: "Analista de Suporte" },
    ],
  },
  {
    titulo: "Comunidade",
    descricao: "Conectamos pessoas e garantimos uma experiência incrível",
    membros: [
      { id: 9, nome: "Aurelia de Oliveira", cargo: "Analista de Suporte ao Cliente" },
      { id: 10, nome: "Maylith Vital", cargo: "Analista de Marketing" },
      { id: 11, nome: "Leandro Soares", cargo: "Analista de Sucesso do Cliente" },
      { id: 12, nome: "Daylan Martins", cargo: "Analista de Sucesso do Cliente" },
      { id: 13, nome: "Gabriela Ribeiro", cargo: "Analista de Marketing" },
      { id: 14, nome: "Gustavo Duarte", cargo: "Analista de Suporte ao Cliente" },
    ],
  },
  {
    titulo: "Produto",
    descricao: "Desenvolvemos soluções que conectam nossos usuários ao máximo desempenho",
    membros: [
      { id: 15, nome: "Antônio Bezerra", cargo: "Analista de Produto" },
      { id: 16, nome: "Thiago Melo", cargo: "Analista de Produto" },
      { id: 17, nome: "Thiago Faria", cargo: "Analista de Produto" },
    ],
  },
];

const Time = () => {
  return (
    <div className="time-container">
      <h1>Nosso Time</h1>

      {secoes.map((secao, index) => (
        <div key={index} className="secao">
          <h2>{secao.titulo}</h2>
          <p>{secao.descricao}</p>

          <div className="membros-container">
            {secao.membros.map((membro) => (
              <div key={membro.id} className="membro">
                <div className="foto-placeholder"></div>
                <h3>{membro.nome}</h3>
                <p>{membro.cargo}</p>
              </div>
            ))}
          </div>
        </div>
      ))}
    </div>
  );
};

export default Time;
